import React from 'react'
import { Link} from "react-router-dom";
const Navbar = () => {
  return (
    <div>
      <div className="navbar">
        <Link to="/Home">Home</Link>
        <Link to="/About">About</Link>
      </div>
    </div>
  )
}

export default Navbar
